#[derive(Debug, Clone, PartialEq, Eq)]
pub struct Todo {
    pub id: usize,
    pub title: String,
    pub done: bool,
}

pub fn add_todo(list: &mut Vec<Todo>, title: &str) -> usize {
    let next_id = list.len() + 1;
    list.push(Todo {
        id: next_id,
        title: title.to_string(),
        done: false,
    });
    next_id
}

pub fn complete_todo(list: &mut [Todo], id: usize) -> bool {
    for item in list {
        if item.id == id {
            item.done = true;
            return true;
        }
    }
    false
}

pub fn pending_count(list: &[Todo]) -> usize {
    list.iter().filter(|item| !item.done).count()
}

